import "./App.css";
import Navbar from "./Components/Navbar";
import SeatBooking from "./Components/SeatBooking";
import LoginPage from "./Components/LoginPage";
import SignUp from "./Components/SignUp";

function App() {
  return (
    <div className="App">
      <Navbar />
      <SeatBooking />
      <LoginPage />
      <SignUp />
    </div>
  );
}

export default App;
